GESTURES = {
	//開啟選取範圍內的所有鏈結(上)
	"U": {
		name: "頁首/開啟選取範圍內的所有鏈結",
		cmd: function() {
			if (getBrowserSelection()) {
				Array.filter(content.document.links, function(link) {
					arguments.callee.uniq = arguments.callee.uniq || [];
					if (!~arguments.callee.uniq.indexOf(link.toString()) && content.getSelection().containsNode(link, 1)) {
						arguments.callee.uniq.push(link.toString());
						return 1;
					}
				}).forEach(function(link) {
					gBrowser.addTab(link.toString()) && content.document.getSelection().removeAllRanges();
				});
			} else {
				goDoCommand("cmd_scrollTop");
			}
		}
	},
	//頁尾(下)
	"D": {
		name: "頁尾",
		cmd: function() {
			goDoCommand("cmd_scrollBottom");
		}
	},
	//上一頁(左)
	"L": {
		name: "上一頁",
		cmd: function() {
			getWebNavigation().canGoBack && getWebNavigation().goBack();
		}
	},
	//下一頁(右)
	"R": {
		name: "下一頁",
		cmd: function() {
		    var nav = gBrowser.webNavigation;
		    var document = content.document;
		    var url = gBrowser.selectedBrowser.currentURI.spec;
		    if (nav.canGoForward) {
		        nav.goForward();
		    } else if (/^https?:\/\/tieba\.baidu\.com\/i\//i.test(url)) {
		        var links = document.links;
		        for (i = 0; i < links.length; i++) {
		            if (/^([^\d^\w.]*(下一页|下一頁|next)[^\d^\w]*|\s*(»|>+|›+)\s*)$/i.test(links[i].text))
		                document.location = links[i].href;
		        }
		    } else {
		        var event = document.createEvent('HTMLEvents');
		        event.initEvent('superPreloader.go', true, false);
		        document.dispatchEvent(event);
		    }
		}
	},
	//全螢幕(上右)
	"UR": {
		name: "全螢幕(",
		cmd: function() {
			BrowserFullScreen();
		}
	},
	//選擇第一個分頁(上左)
	"UL": {
		name: "選擇第一個分頁",
		cmd: function() {
			gBrowser.selectedTab = (gBrowser.visibleTabs || gBrowser.mTabs)[0];
		}
	},
	//關閉左側分頁(下左)
	"DL": {
		name: "關閉左側分頁",
		cmd: function() {
			var tabs = gBrowser.mTabContainer.childNodes;
			for (var i = tabs.length - 1; tabs[i] != gBrowser.mCurrentTab; i--) {}
			for (i--; i >= 0; i--) {
				gBrowser.removeTab(tabs[i]);
			};
		}
	},
	//關閉右側分頁(下右)
	"DR": {
		name: "關閉右側分頁",
		cmd: function() {
			var tabs = gBrowser.mTabContainer.childNodes;
			for (var i = tabs.length - 1; tabs[i] != gBrowser.selectedTab; i--) {
				gBrowser.removeTab(tabs[i]);
			};
		}
	},
	//關閉其他分頁(下上)
	"DU": {
		name: "關閉其他分頁",
		cmd: function() {
			gBrowser.removeAllTabsBut(gBrowser.mCurrentTab);
		}
	},
	//重新載入分頁 跳過暫存(左右)
	"LR": {
		name: "重新載入分頁 跳過暫存",
		cmd: function() {
			BrowserReloadSkipCache();
		}
	},
	//重新載入所有分頁(右左)
	"RL": {
		name: "重新載入所有分頁",
		cmd: function() {
			gBrowser.reloadAllTabs();
		}
	},
	//翻譯(左下)
	"LD": {
		name: "翻譯",
		cmd: function() {
			var t = content.getSelection().toString();
			if (t) {
				gBrowser.selectedTab = gBrowser.addTab("https://translate.google.com.tw/?hl=zh-TW#auto|zh-TW|" + t);
			} else {
				loadURI("https://translate.google.com.tw/translate?sl=auto&tl=zh-TW&u=" + content.location);
			}
		}
	},
	//簡轉繁(右下)
	"RD": {
		name: "簡轉繁",
		cmd: function() {
			content.document.documentElement.appendChild(content.document.createElement("script")).src = "data:application/javascript;base64,";
		}
	},
	//繁轉簡(右下右)
	"RDR": {
		name: "繁轉簡",
		cmd: function() {
			content.document.documentElement.appendChild(content.document.createElement("script")).src = "data:application/x-javascript;base64,";
		}
	}, //全選並複製(上右下)
	"URD": {
		name: "全選並複製",
		cmd: function() {
			goDoCommand('cmd_selectAll');
			setTimeout('goDoCommand("cmd_copy");', 100);
			setTimeout('content.document.getSelection().removeAllRanges();', 100);
		}
	}, //關閉分頁(按住右鍵點擊左鍵)
	"L<R": {
		name: "關閉分頁",
		cmd: function() {
			gBrowser.removeCurrentTab();
		}
	},
	//恢復關閉的分頁(按住左鍵點擊右鍵)
	"L>R": {
		name: "恢復關閉的分頁",
		cmd: function() {
			undoCloseTab();
		}
	},
	//上一個分頁(按住右鍵滾輪向上)
	"W-": {
		name: "上一個分頁",
		cmd: function() {
			gBrowser.tabContainer.advanceSelectedTab(-1, true);
		}
	},
	//下一個分頁(按住右鍵滾輪向下)
	"W+": {
		name: "下一個分頁",
		cmd: function() {
			gBrowser.tabContainer.advanceSelectedTab(1, true);
		}
	},
}